    "    \n",
    "    rules = wang_mendel(train_data, mf)\n",
    "    \n",
    "    predictions = []\n",
    "    for _, row in train_data.iterrows():\n",
    "        aggregated_mf, activated_mfs = fuzzy_inference(row, rules, universe, mf)\n",
    "        prediction = defuzzify(aggregated_mf, universe)\n",
    "        predictions.append(prediction)\n",
    "\n",
    "    actual_values = train_data[\"Close\"].values\n",
    "    return mse(predictions, actual_values)\n",
    "\n",
    "bounds = [(data[var].min(), data[var].max()) for var in ['Close', 'Shares traded', 'Moving_average_50', 'RSI_14']]\n",
    "res = differential_evolution(optimize_mf, bounds, maxiter=50, popsize=10)\n",
    "optimal_midpoints = res.x\n",
    "\n",
    "for idx, var in enumerate(['Close', 'Shares traded', 'Moving_average_50', 'RSI_14']):\n",
    "    values = universe[var]\n",
    "    mf[var]['Medium'] = fuzz.trimf(values, [data[var].min(), optimal_midpoints[idx], data[var].max()])\n",
    "\n",
