    "import matplotlib.pyplot as plt\n",
    "\n",
    "prophet_plot_data = forecast_prophet_fine_tuned[['ds', 'yhat']]\n",
    "mamdani_plot_data = results[['date', 'actual', 'forecasted']]\n",
    "\n",
    "prophet_plot_data['ds'] = pd.to_datetime(prophet_plot_data['ds'])\n",
    "mamdani_plot_data['date'] = pd.to_datetime(mamdani_plot_data['date'])\n",
    "\n",
    "plt.figure(figsize=(18, 8))\n",
    "\n",
    "plt.plot(mamdani_plot_data['date'], mamdani_plot_data['actual'], label='Actual', color='blue', linewidth=1)\n",
    "\n",
    "plt.plot(prophet_plot_data['ds'], prophet_plot_data['yhat'], label='Prophet Forecasted', color='red', linestyle='--')\n",
    "\n",
    "plt.plot(mamdani_plot_data['date'], mamdani_plot_data['forecasted'], label='Mamdani Forecasted', color='green', linestyle='--')\n",
    "\n",
    "plt.title('Actual vs Prophet and Mamdani Forecasted Data')\n",
    "plt.xlabel('Date')\n",
    "plt.ylabel('Value')\n",
    "plt.legend()\n",
    "plt.grid(True)\n",
    "\n",
    "plt.show()\n"
